//IMPORTANDO TYPES
import {
  TRAER_DOCUMENTOPDF,
  TRAER_DOCUMENTOPDF_EXITO,
  TRAER_DOCUMENTOPDF_ERROR,
} from "../types";

//TRAER LOS DOCUMENTOS
//recibimos el tipo de documento y el numero de documento desde componente documento
export function traerDocumentosActions(documento) {
  return (dispatch) => {
      dispatch (traerProducto())
    console.log(documento);
  };
}
